import React from 'react';
import { AppProvider } from './AppContext';
import { BrowserRouter, Route, Routes,Link } from 'react-router-dom';
import Home from './Pages/Home/Home';
const App = () => {
    return (
        <div>
            <AppProvider>
            
                <BrowserRouter>
                <Home/>
                <Routes>
                    <Route></Route>
                </Routes>
                
                </BrowserRouter>

            </AppProvider>
            
        </div>
    );
}

export default App;
